"use strict";(self.webpackChunkwilliamhmw_github_io=self.webpackChunkwilliamhmw_github_io||[]).push([[1477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"passo-a-passo-to-do","metadata":{"permalink":"/blog/passo-a-passo-to-do","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-29-app-gocal.md","source":"@site/blog/2022-06-29-app-gocal.md","title":"Criando o App goCal","description":"Um guia com o passo a passo de como criar uma aplica\xe7\xe3o em React Native, explicando a l\xf3gica das fun\xe7\xf5es, arquivos e decis\xf5es.","date":"2022-06-29T00:00:00.000Z","formattedDate":"June 29, 2022","tags":[{"label":"mobile","permalink":"/blog/tags/mobile"},{"label":"react native","permalink":"/blog/tags/react-native"},{"label":"JSX","permalink":"/blog/tags/jsx"},{"label":"state","permalink":"/blog/tags/state"},{"label":"props","permalink":"/blog/tags/props"},{"label":"to-do","permalink":"/blog/tags/to-do"},{"label":"aplica\xe7\xe3o","permalink":"/blog/tags/aplicacao"},{"label":"app","permalink":"/blog/tags/app"}],"readingTime":2.665,"truncated":true,"authors":[{"name":"William Honorio","title":"Desenvolvedor em aprendizado","url":"https://github.com/williamhmw","imageURL":"https://raw.githubusercontent.com/williamhmw/williamhmw.github.io/main/blog/william.jpg","key":"william"}],"frontMatter":{"slug":"passo-a-passo-to-do","title":"Criando o App goCal","authors":"william","tags":["mobile","react native","JSX","state","props","to-do","aplica\xe7\xe3o","app"]},"nextItem":{"title":"O b\xe1sico do React Native","permalink":"/blog/o-basico-do-react-native"}},"content":"> Um guia com o passo a passo de como criar uma aplica\xe7\xe3o em React Native, explicando a l\xf3gica das fun\xe7\xf5es, arquivos e decis\xf5es.\\r\\n\\r\\n> Esse guia \xe9 um resumo do que entendi e aprendi durante um curso para que eu possa aplicar os conceitos em outros projetos.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n### Iniciando um novo projeto em React Native  \\r\\n\\r\\nNo VS Code abrimos u novo terminal e iniciamos com o comando abaixo.\\r\\n\\r\\n```bash title=\\"Criar novo projeto\\"\\r\\nnpx react-native init AppGoCal\\r\\n```\\r\\n\\r\\nDepois de executar o comando ser\xe1 feito o download do template do React Native e criado a pasta do projeto com o nome AppGoCal\\r\\n\\r\\nPara iniciar o projeto e verificar como o App est\xe1 execute o comando abaixo:\\r\\n\\r\\n```bash title=\\"Iniciar emulador Metro\\"\\r\\nnpx react-native start\\r\\n```\\r\\n\\r\\nIsso ir\xe1 executar o `Metro`, compilador respons\xe1vel por gerar os c\xf3digos em Javascript para o emulador, na sequ\xeancia abra um novo terminal e execute o comando abaixo para iniciar o emulador.\\r\\n\\r\\n```bash title=\\"Iniciar emulador android\\"\\r\\nnpx react-native run-android\\r\\n```\\r\\n\\r\\n### Limpando os arquivos\\r\\n\\r\\nPara iniciar a contru\xe7\xe3o do aplicativo vamos deletar e modificar alguns arquivos que vem no template padr\xe3o do React Native quando criamos o projeto.\\r\\n\\r\\nPara come\xe7ar vamos criar uma pasta na raiz do projeto chamada `src`, dentro dela criaremos duas pastas, a `pages` e `components`. Essas modifica\xe7\xf5es s\xe3o feitas por quest\xf5es de organiza\xe7\xe3o.\\r\\n\\r\\nPodemos apagar o arquivo `.eslintrc.js` e `.prettierrc.js`, no momento n\xe3o vamos utiliz\xe1-los.\\r\\n\\r\\nNo arquivo `App.js` vamos apagar todo o c\xf3digo inicial e colocar o c\xf3digo abaixo.\\r\\n\\r\\n```js showLineNumbers title=\\"@/App.js\\"\\r\\nimport React from \'react\';\\r\\nimport { StatusBar } from \'react-native\';\\r\\n\\r\\nimport { Home } from \'./src/pages/Home\';\\r\\n\\r\\nexport default function App() {\\r\\n  return (\\r\\n    <>\\r\\n      <StatusBar \\r\\n        barStyle=\\"light-content\\" \\r\\n        translucent \\r\\n        backgroundColor=\\"transparent\\" \\r\\n      />\\r\\n      <Home />\\r\\n    </>\\r\\n  );\\r\\n}\\r\\n```\\r\\nO `StatusBar` \xe9 um componente utilziado para controla a barra de status do iOS e Android, onde \xe9 exibido, a hora, notifica\xe7\xf5es, baterias, etc.\\r\\n\\r\\nDessa forma estamos passando um estilo \\"claro\\" e o background da barra de status como transparente.\\r\\n\\r\\nDepois vamos criar um novo arquivo em `src/pages` chamado `Home.js`, \xe9 ele que \xe9 refenciado no c\xf3digo acima como `{ Home }`, ele ser\xe1 respons\xe1vel pela p\xe1gina inicial do App.\\r\\n\\r\\nNele colocaremos o seguinte c\xf3digo\\r\\n\\r\\n\\r\\n```js showLineNumbers title=\\"./src/pages/Home.js\\"\\r\\nimport React from \'react\';\\r\\nimport { View, Text } from \'react-native\';\\r\\n\\r\\n\\r\\nexport function Home() {\\r\\n  return (\\r\\n    <View>\\r\\n        <Text>\\r\\n        // highlight-next-line\\r\\n                Welcome in App for calculate calories, William!\\r\\n        </Text>\\r\\n    </View>\\r\\n  )\\r\\n};\\r\\n```\\r\\nNa tela dever\xe1 aparecer o texto Welcome in App for calculate calories, William!.\\r\\n\\r\\n### Come\xe7ando a estilizar o App\\r\\n\\r\\nPara come\xe7ar a estilizar o App vamos utilizar o componente `StyleSheet`.\\r\\n\\r\\nPrimeiro vamos criar uma vari\xe1vel respons\xe1vel pelos estilos chamado `styles` e passar algumas informa\xe7\xf5es envolvendo em um container.\\r\\n\\r\\n```js showLineNumbers title=\\"./src/pages/Home.js\\"\\r\\nconst styles = StyleSheet.create({\\r\\n    container:{\\r\\n        flex: 1,\\r\\n        backgroundColor: \'#DCDCE5\',\\r\\n        paddingVertical:70,\\r\\n        paddingHorizontal:30,\\r\\n    }\\r\\n    \\r\\n})\\r\\n```\\r\\n\\r\\nDepois vamos passar esse estilo para a View principal.\\r\\n\\r\\n```js showLineNumbers title=\\"./src/pages/Home.js\\"\\r\\nimport React from \'react\';\\r\\nimport { View, Text } from \'react-native\';\\r\\n\\r\\n\\r\\nexport function Home() {\\r\\n  return (\\r\\n    // highlight-next-line\\r\\n     <View style={styles.container}>\\r\\n        <Text>\\r\\n                Para come\xe7ar como podemos te chamar?\\r\\n        </Text>\\r\\n    </View>\\r\\n  )\\r\\n};\\r\\n```\\r\\n\\r\\nNos componentes que desejamos passar um estilo, basta colocar no formato do c\xf3digo abaixo.\\r\\n\\r\\n```js showLineNumbers title=\\"./src/pages/Home.js\\"\\r\\n     <View style={styles.nomedoobjeto}>\\r\\n        <Text style={styles.nomedoobjeto2}>\\r\\n                Exemplo\\r\\n        </Text>\\r\\n    </View>\\r\\n```\\r\\n### Adicionando"},{"id":"o-basico-do-react-native","metadata":{"permalink":"/blog/o-basico-do-react-native","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-17-o-basico.md","source":"@site/blog/2022-06-17-o-basico.md","title":"O b\xe1sico do React Native","description":"Aqui vai um resumo sobre os recursos b\xe1sicos de como funciona uma aplica\xe7\xe3o no React Native.","date":"2022-06-17T00:00:00.000Z","formattedDate":"June 17, 2022","tags":[{"label":"mobile","permalink":"/blog/tags/mobile"},{"label":"react native","permalink":"/blog/tags/react-native"},{"label":"JSX","permalink":"/blog/tags/jsx"},{"label":"state","permalink":"/blog/tags/state"},{"label":"props","permalink":"/blog/tags/props"}],"readingTime":2.44,"truncated":true,"authors":[{"name":"William Honorio","title":"Desenvolvedor em aprendizado","url":"https://github.com/williamhmw","imageURL":"https://raw.githubusercontent.com/williamhmw/williamhmw.github.io/main/blog/william.jpg","key":"william"}],"frontMatter":{"slug":"o-basico-do-react-native","title":"O b\xe1sico do React Native","authors":"william","tags":["mobile","react native","JSX","state","props"]},"prevItem":{"title":"Criando o App goCal","permalink":"/blog/passo-a-passo-to-do"},"nextItem":{"title":"Comandos em terminais","permalink":"/blog/comandos-em-terminais"}},"content":"Aqui vai um resumo sobre os recursos b\xe1sicos de como funciona uma aplica\xe7\xe3o no React Native.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\nPrimeiramente fazemos a importa\xe7\xe3o do React para que seja poss\xedvel utilizar o JSX, depois importamos alguns componentes que s\xe3o do React native.\\r\\n\\r\\n```js showLineNumbers title=\\"Import\\"\\r\\nimport React from \'react\';\\r\\nimport { Text, View } from \'react-native\';\\r\\n```\\r\\n\\r\\nO c\xf3digo abaixo tem algumas l\xf3gcas para analisar.\\r\\n\\r\\n```js showLineNumbers title=\\"Hello world\\"\\r\\nconst HelloWorldApp = () => {\\r\\n  return (\\r\\n    // highlight-next-line\\r\\n    <View\\r\\n      style={{\\r\\n        flex: 1,\\r\\n        justifyContent: \\"center\\",\\r\\n        alignItems: \\"center\\"\\r\\n      }}>\\r\\n      // highlight-next-line\\r\\n      <Text>Hello, world!</Text>\\r\\n      // highlight-next-line\\r\\n    </View>\\r\\n  )\\r\\n}\\r\\nexport default HelloWorldApp;\\r\\n```\\r\\n\\r\\nO `<View>` e o `<Text>` s\xe3o componentes do React, sendo o `Text` para renderizar textos e o `View` para renderizar um cont\xeainer.\\r\\n\\r\\nNo c\xf3digo acima passamos um estilo para tudo que estiver dentro do componente `View`.\\r\\n\\r\\nO `HelloWorldApp` \xe9 um novo componente que criamos, dentrod e uma aplica\xe7\xe3o possu\xedmos deversos componentes.\\r\\n\\r\\n\\r\\nO pr\xf3ximo conceito s\xe3o os `Props`, que s\xe3o componentes criados por n\xf3s que podem ser utilizados em v\xe1rios locais diferentes no aplicativo, capaz de alterar alguns par\xe2metros dependendo de onde estiver.\\r\\n\\r\\n\\r\\n```js showLineNumbers title=\\"Hello props\\"\\r\\nimport React from \'react\';\\r\\nimport { Text, View, StyleSheet } from \'react-native\';\\r\\n// highlight-start\\r\\nconst styles = StyleSheet.create({\\r\\n  center: {\\r\\n    alignItems: \'center\'\\r\\n  }\\r\\n})\\r\\n// highlight-end\\r\\n\\r\\n// highlight-start\\r\\nconst Greeting = (qualquernome) => {\\r\\n  return (\\r\\n    <View style={styles.center}>\\r\\n      <Text>Hello {qualquernome.name}!</Text>\\r\\n    </View>\\r\\n  );\\r\\n}\\r\\n// highlight-end\\r\\n\\r\\n// highlight-start\\r\\nconst LotsOfGreetings = () => {\\r\\n  return (\\r\\n    <View style={[styles.center, {top: 50}]}>\\r\\n      <Greeting name=\'Rexxar\' />\\r\\n      <Greeting name=\'Jaina\' />\\r\\n      <Greeting name=\'Valeera\' />\\r\\n    </View>\\r\\n  );\\r\\n}\\r\\n\\r\\n// highlight-end\\r\\n// highlight-next-line\\r\\nexport default LotsOfGreetings;\\r\\n```\\r\\n\\r\\n1 - O c\xf3digo `const styles` cria uma vari\xe1vel de estilo que pode ser utilizada diversas vezes para v\xe1rios componentes, isso permite por exemplo clocar somente o tipo de fonte, cor, etc uma vez, depois quando se quer passar o mesmo atributo para outro componente basta passar a var\xedavel criada.\\r\\n\\r\\n2 - No c\xf3digo criamos a vari\xe1vel `Greeting` e passamos um nome para ela, no caso `qualquernome`.\\r\\nEm `<View>` colocamos o estilo j\xe1 parametrizado acima, em `<Text>` passamos o texto a ser renderiado e acresentamos dentro das chaves `{}` o nome do nosso props, no caso `qualquernome` e inserimos um `.` e colocamos qualquer outro nome a frente, no caso `name`.\\r\\nA vari\xe1vel que passamos precisa ser escrita no formato `{qualquernome.name}` funciona da seguinte forma, o primeiro \xe9 o nome passado para a fun\xe7\xe3o, e o segundo o nome do props.\\r\\n\\r\\n3 - Criamos outra vari\xe1vel na qual receberemos outros valores para o props, alterando assim os nomes.\\r\\nEm `<View>` colocamos o estilo j\xe1 parametrizado acima e acresentamos mais um estilo na pr\xf3rpia linha do view.\\r\\nLogo abaixo colocamos o nome da fun\xe7\xe3o acima, no caso `Greeting` e passamos para o props o nome que desejamos.\\r\\nQuando chamamos `<Greeting` estamos puxando a fun\xe7\xe3o logo acima e colocando ou valor para `name=`\\r\\n\\r\\n4 - Pra finalizar exportamos a fun\xe7\xe3o `LotsOfGreetings` para ela ser renderizada na tela."},{"id":"comandos-em-terminais","metadata":{"permalink":"/blog/comandos-em-terminais","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-16-comandos-em-terminais.md","source":"@site/blog/2022-06-16-comandos-em-terminais.md","title":"Comandos em terminais","description":"Para executar algumas a\xe7\xf5es no dia-a-dia precisamos executar alguns comandos atrav\xe9s de terminais. Abaixo uma listagem com os principais para quem esta estudando React Native.","date":"2022-06-16T00:00:00.000Z","formattedDate":"June 16, 2022","tags":[{"label":"comandos","permalink":"/blog/tags/comandos"},{"label":"mobile","permalink":"/blog/tags/mobile"},{"label":"react","permalink":"/blog/tags/react"},{"label":"terminal","permalink":"/blog/tags/terminal"},{"label":"powershell","permalink":"/blog/tags/powershell"}],"readingTime":0.975,"truncated":true,"authors":[{"name":"William Honorio","title":"Desenvolvedor em aprendizado","url":"https://github.com/williamhmw","imageURL":"https://raw.githubusercontent.com/williamhmw/williamhmw.github.io/main/blog/william.jpg","key":"william"}],"frontMatter":{"slug":"comandos-em-terminais","title":"Comandos em terminais","authors":"william","tags":["comandos","mobile","react","terminal","powershell"]},"prevItem":{"title":"O b\xe1sico do React Native","permalink":"/blog/o-basico-do-react-native"},"nextItem":{"title":"Primeiro post","permalink":"/blog/primeiro-post"}},"content":"Para executar algumas a\xe7\xf5es no dia-a-dia precisamos executar alguns comandos atrav\xe9s de terminais. Abaixo uma listagem com os principais para quem esta estudando React Native.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n:::info\\r\\n\\r\\nEsses comandos s\xe3o para executar um app em um emulador android, depois de seguir todo um processo de instala\xe7\xe3o e configura\xe7\xe3o.\\r\\n\\r\\n:::\\r\\n\\r\\nExecutar o `Metro` para emular o app no emulador:\\r\\n```git showLineNumbers title=\\"Iniciar Metro\\"\\r\\nnpm start\\r\\n```\\r\\n\\r\\nEm seguida executar o comando para iniciar o emulador do android:\\r\\n```git showLineNumbers title=\\"Iniciar Emulador Android\\"\\r\\nyarn android\\r\\n```\\r\\n\\r\\n\\r\\n:::info\\r\\n\\r\\nEsses comandos s\xe3o para executar o Docosaurus, plataforma de documena\xe7\xe3o e blog.\\r\\n\\r\\n:::\\r\\n\\r\\nExecutar o `Build` para gerar os arquivos est\xe1ticos que v\xe3o para o GitHub Pages\\r\\n```bash showLineNumbers title=\\"Iniciar build\\"\\r\\nnpm run build\\r\\n```\\r\\n\\r\\nExecutar o `Serve` para iniciar no servidor local localhost.\\r\\n```bash showLineNumbers title=\\"Iniciar servidor local\\"\\r\\nnpm run build\\r\\n```\\r\\n\\r\\nExecutar o `GIT_USER` para iniciar o deploy no GitHub Pages.\\r\\n```bash showLineNumbers title=\\"Iniciar deploy\\"\\r\\nGIT_USER=<GITHUB_USERNAME> yarn deploy\\r\\n```\\r\\n\\r\\nNo caso trocar o `<GITHUB_USERNAME>` pelo nome configurado no terminal.\\r\\n\\r\\nSe for executar pelo terminal do PowerShell deve ser inserido o c\xf3digo abaixo.\\r\\n\\r\\n```bash showLineNumbers title=\\"Iniciar deploy pelo Poweshell\\"\\r\\ncmd /C \'set \\"GIT_USER=<GITHUB_USERNAME>\\" && yarn deploy\'\\r\\n```\\r\\n\\r\\n\\r\\n**Bora codar!!!**"},{"id":"primeiro-post","metadata":{"permalink":"/blog/primeiro-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-15-first-post.md","source":"@site/blog/2022-06-15-first-post.md","title":"Primeiro post","description":"Criei esse blog para compartilhar meu aprendizado durante minha fase de estudos, inicialmente em react e mobile.","date":"2022-06-15T00:00:00.000Z","formattedDate":"June 15, 2022","tags":[{"label":"estudos","permalink":"/blog/tags/estudos"},{"label":"mobile","permalink":"/blog/tags/mobile"},{"label":"react","permalink":"/blog/tags/react"}],"readingTime":0.185,"truncated":true,"authors":[{"name":"William Honorio","title":"Desenvolvedor em aprendizado","url":"https://github.com/williamhmw","imageURL":"https://raw.githubusercontent.com/williamhmw/williamhmw.github.io/main/blog/william.jpg","key":"william"}],"frontMatter":{"slug":"primeiro-post","title":"Primeiro post","authors":"william","tags":["estudos","mobile","react"]},"prevItem":{"title":"Comandos em terminais","permalink":"/blog/comandos-em-terminais"}},"content":"Criei esse blog para compartilhar meu aprendizado durante minha fase de estudos, inicialmente em `react` e `mobile`.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\nRegular blog authors can be added to `authors.yml`.\\r\\n\\r\\nOs dois princpais ilares ser\xe3o:\\r\\n\\r\\n- `Dicas`\\r\\n- `Resumos`\\r\\n\\r\\n**Bora codar!!!**"}]}')}}]);